if (!items.length) {
  throw new Error("Нет входных данных");
}

// Забираем входные данные
const input = items[0].json;

// Если нет поля output, ничего распарсить не получится
if (!input.output) {
  return [
    {
      json: {
        error: "Поле 'output' не найдено во входном JSON",
        inputData: input
      }
    }
  ];
}

// 1. Забираем строку из поля output
let rawOutput = input.output;

// 2. Удаляем обёртку в стиле Markdown, если она есть
//    Например, если строка начинается с ```json\n и заканчивается \n```.
rawOutput = rawOutput
  .replace(/^```json\s*/i, "") // удаляем ```json с начала
  .replace(/```$/i, "")        // удаляем ``` в конце (если на отдельной строке)

// 3. Теперь пробуем распарсить эту строку как JSON
let parsedData;
try {
  parsedData = JSON.parse(rawOutput);
} catch (error) {
  return [
    {
      json: {
        error: `Не удалось распарсить содержимое 'output' как JSON: ${error.message}`,
        rawOutput
      }
    }
  ];
}

// 4. Проверяем нужные поля
const platforms = ["facebook", "instagram", "twitter", "whatsapp", "telegram"];
const outputs = [];

for (const platform of platforms) {
  if (parsedData[platform]) {
    outputs.push({
      json: {
        platform,
        url: parsedData[platform]
      }
    });
  }
}

// Если ни одного поля не найдено, возвращаем сообщение
if (outputs.length === 0) {
  outputs.push({
    json: {
      error: "Ни одно из полей (facebook, instagram, twitter, whatsapp, telegram) не найдено во вложенном JSON",
      parsedData
    }
  });
}

// Возвращаем массив результатов
return outputs;

const combinedData = items.map(item => item.json.data).join("\n");

// Возвращаем один объект, в котором поле "data" содержит объединённую информацию.
return [
  {
    json: {
      data: combinedData
    }
  }
];

