const errorMsg = "No data was found. Check website and attribute descriptions. If issue persists, contact us at contact@parsera.org.";

// Обрабатываем входящие элементы
const newItems = items
  .map(item => {
    // Если значение поля message соответствует заданной строке, удаляем его
    if (item.json.message === errorMsg) {
      delete item.json.message;
    }
    return item;
  })
  // Фильтруем элементы
  .filter(item => {
    // Фильтрация по полю data:
    const data = item.json.data;
    if (data === null || data === undefined) return false;
    if (Array.isArray(data) && data.length === 0) return false;

    // Фильтрация по содержимому "cookiepedia.co.uk":
    // Если в любом из значений объекта встречается нужная подстрока, элемент не проходит фильтр.
    const jsonString = JSON.stringify(item.json);
    if (jsonString.includes("cookiepedia.co.uk")) {
      return false;
    }

    return true;
  });

